# Split data into rows by newline
lines = data.strip().split("\n")

# Extract headers from the first line
headers = lines[0].split()

# Prepare a list to store parsed data
records = []

# Parse each record
for line in lines[1:]:
    # Split each line into parts (assuming space separation in this case)
    parts = line.split()

    # Extract data for each column based on the headers
    record = {
        'Title': parts[0],
        'Name': ' '.join(parts[1:-4]),  # Join all parts between title and company
        'ID': parts[-4],
        'Email': parts[-3],
        'Company': parts[-2],
        'Updated': parts[-1]
    }

    # Append the record to the list
    records.append(record)

# Function to print the table with proper formatting
def print_table(records):
    # Print the header row
    print(f"{'Title':<5} {'Name':<30} {'ID':<10} {'Email':<30} {'Company':<30} {'Updated':<10}")
    print("-" * 110)

    # Print each record
    for record in records:
        print(f"{record['Title']:<5} {record['Name']:<30} {record['ID']:<10} {record['Email']:<30} {record['Company']:<30} {record['Updated']:<10}")

# Print the parsed table
print_table(records)
